Insert into LISTA_DESCARGA_I (ID,ID_IDIOMA,TITULO,TEXTO) values ('1153','0','Este Plan, editado por la Dirección General de Inmigración y Cooperación al Desarrollo, del Departamento de Serrvicios Sociales y Famiia del Gobierno de Aragón, es un plan transversal, ambicioso y de dos direcciones: Por un lado, garantiza a la población de origen extranjero el acceso en igualdad de condiciones a los servicios públicos, la práctica de sus derechos y el respeto a su diversidad cultural en el marco de los derechos humanos y los valores y principios democráticos; Por otro, compromete a la población autóctona su conocimiento, comprensión y respeto por los nuevos aragonesesy las nuevas aragonesas. No es un Plan para la Inmigración. Es un Plan para la Convivencia y una política para toda la población. Porque es un reto y una oportunidad para un Aragón más libre e igualitario y un compromiso del Gobierno de Aragón con todos los aragoneses y todas las aragonesas.',null);
