Insert into LISTA_DESCARGA_I (ID,ID_IDIOMA,TITULO,TEXTO) values ('1451','0','Equity and Quality in Education. Supporting Disadvantages Students and Schools (OCDE)          ','Reducir el fracaso escolar redunda en beneficios tanto para la sociedad como para los individuos. Los sistemas educativos con el desempeño más alto en los países de la OCDE combinan calidad con equidad. Este informe ofrece recomendaciones de políticas para sistemas educativos de manera que se contribuyan a que todos los menores cumplan de manera exitosa su escolaridad. Acceda al Resumen Ejecutivo en Castellano:');
